VALUES
	(1,'WePlay Season 3','WPS3','2016-12-30','2016-12-30 08:00:00','2016-12-31 08:00:00','DescriptionOverview\r\n\r\nThe Dota Major Championships is a championship series announced by Valve in 2015 as part of their plans for improving the competitive Dota 2 landscape as a whole.\r\n\r\nA New Tradition\r\nIn April 2015, Valve announced their plans for improving the competitive Dota 2 landscape as a whole by hosting an annual series of four marquee tournaments leading up to the already well established The International. The three additional Valve-sponsored Major Tournaments are hosted by third-party organizers at different locations around the world, with the goal of increasing fan-team engagement as well as competitive and team roster stability during the year. The four tournament events, starting after the The International 2015 will be held annually during the Fall, Winter and Spring culminating in the Summer event, The International.\r\n\r\nFirst Major\r\nThe first Valve-sponsored Dota Major Championship Event, The Frankfurt Major, was announced in September 2015. It featured a fixed prize pool of $3,000,000 and was hosted by ESL at Festhalle Messe in Frankfurt, Germany.\r\n    \r\n    \r\n    \r\n    \r\n    ',0,1,'2016-03-08 20:04:09','2016-03-16 19:50:28'),
