INSERT INTO `leagues` (`leagueid`, `name`, `description`, `tournament_url`, `itemdef`, `is_finished`)
VALUES
	(0,'JetsetPro Amateur League 1x1 Season 1','64 players will compete for the tournament prize money of 1,000 rubles','',0,0),
	(2,'Wild Cards West','Watch eight of the best Dota 2 teams compete for a spot in The International','http://www.dota2.com/tournaments/international/',15015,0),
	(3,'Wild Cards East','Watch eight of the best Dota 2 teams compete for a spot in The International','http://www.dota2.com/tournaments/international/',15016,0),
	(4,'The Defense','The Defense is the most prestigious Dota 2 online tournament held by joinDOTA, powered by Razer & BenQ. Featuring 20 hand-selected world-class teams and four community wildcard winners $10,000 prize money await only the toughest and most experienced of contestants on their way to the top.','http://www.the-defense.com/en/start',15018,0),
	(5,'It\'s Gosu Monthly Madness Asia','It\'s Gosu Monthly Madness is a Dota 2 tournament hosted by It\'s Gosu eSports and generously sponsored by Own3D.Tv, Razer and NOS Energy Drinks. Throughout the month of July, 16 of the best teams in Asia will clash and only the finalists will share a part of the prizepool of $1,000.','http://www.itsgosu.com/game/dota2/articles/it-s-gosu-announces-monthly-madness-asia-edition_563',15042,0),
	(6,'Star Series Season II Lan Final','Star Series is one of the most prestigious Dota 2 leagues held by StarLadder, and powered by Intel and Asus. The keystone of Star Series is the LAN final, which is held in Kiev CyberSport Arena, Ukraine. Watch the six best teams compete for the Grand Prize of $15,000 and the title Star Series Champion.','http://dota2.starladder.tv/news/1182',15047,0),
	(7,'BeyondTheSummit World Tour','BeyondTheSummit World Tour features 15 of the 16 teams attending The International. Brought to you in association with DotaCommentaries this warmup event is sure to whet your appetite as competitors from four different continents compete for the $1,000 prize that awaits only the top placing team.','http://www.dotacommentaries.com/index.php/bts-wt/',15049,0),
	(8,'Prodota 2 Worldwide League','Prodota 2 takes its tournament to the world stage during the play-offs, featuring some of the most well known and talented teams from around the globe. With $30,000 in prize money on the line we\'ll find out which region of the world truly has the best of the best!','http://www.prodota2.com/',15051,0),
	(9,'Machinima ECAL: Americas','ECAL playoffs will feature 3 teams from the international: EG, coL, and aL along with up and coming teams in the competitive scene such as Quantic Gaming and POTM BOTTOM. A $3,000 prize pool sponsored by Machinima will be offered to the victors.','http://www.ecal.tv/playoffs',15053,0),
	(10,'Razer Mini Madness','Razer Mini Madness is a Dota 2 tournament hosted by It\'s Gosu eSports and generously sponsored by Razer. Eight of the best teams in Asia will compete and will try to bag the $500 prize. This tournament is the last opportunity for the teams to get ready for this year\'s The International.','http://www.itsgosu.com/game/dota2/articles/it-s-gosu-presents-razer-mini-madness_621',15063,0),
	(11,'AbsoluteArena King of the Hill','AbsoluteArena King of the Hill is a tournament consisting of a weekly match-up between two teams in a best-of-5 format. The first win is $100, and the prize increases every week by $100. Teams are able to win five games in a row ($1500) at which time the series starts over.','http://www.absolutelegends.net/news/2069/AbsoluteArena-King-of-the-Hill-Schedule-Update',15065,0),
	(12,'RaidCall Dota 2 League','The RaidCall Dota 2 League is a $10,000 online Dota 2 tournament series featuring the top Dota 2 teams from around the globe. Broadcast four days a week for over eight weeks, the D2L (as it\'s commonly called) is commentated live by Ayesee and invited guests.','http://d2l.evilgeniuses.net',15075,0),
	(13,'Star Series Season III','StarLadder\'s Star Series is one of the most prestigious Dota 2 leagues, powered by Intel & Asus and casted by v1lat and TobiWan. The keystone of Star Series is the LAN final, held in Kiev CyberSport Arena, Ukraine. Watch the best Dota 2 teams compete for $15,000 and the title Star Series Champion.','http://dota2.starladder.tv',15077,0),
	(14,'GEST Dota 2','The Gigabyte E-Sports Tournament is sponsored by Gigabyte and hosted by DotaTalk. The winners of six qualifiers from South-East Asia will face off against veteran teams for a cash prize of $1,500 and the chance to compete against two of the best Chinese teams, IG and LGD, for another $1500.','http://www.dotatalk.com/tournaments/gest/',15081,0),
	(15,'Premier League','Fueled by joint forces of TwitchTV and SteelSeries, Season 3 is the newest edition of The Premier League. Watch 10 of the best teams from both Europe and North America contend for $6,000 with 5 intense matches every week for 9 weeks. Commentary by TriumphOfMan.','www.thepremierleague.eu',15083,0),
	(16,'GosuLeague','GosuLeague delivers seasons on a monthly basis where teams of all skill levels play in different divisions. The top division is awarded with $5000 each month. Each team play two matches a week.','http://play.gosugamers.net/events/48:gosuleague-season-4',15085,0),
	(17,'G-1 Championship League','The G-1 Championship League, hosted by 17173 Games, is the first Dota 2 tournament in China. Exciting matches await with teams like iG, LGD and DK competing for a prize pool of $50,000.','http://media.17173.com/dota/g1/',15096,0),
	(18,'atoD 2','atoD 2 features 8 top North American and European teams. Using Reverse Captain\'s Mode, teams will surely play unconventional heroes and sabotage each other\'s lineups.  With some of the proceeds going to the prize it\'s the first tournament to include a direct way for fans to increase the prizepool.','',15099,0),
	(19,'It\'s Gosu Asia Madness','It\'s Gosu returns with its third edition of the Asia Madness where the ten best teams from Asia will be competing for a prize pool of $5,000 in a triple elimination format.','http://www.itsgosu.com/game/dota2/articles/it-s-gosu-asia-madness-for-love-completes-the-line-up_802',15101,0),
	(20,'Star Series Season IV','StarLadder\'s Star Series is one of the most prestigious Dota 2 leagues, powered by Intel & Asus and casted by v1lat and TobiWan. The keystone of Star Series is the LAN final, held in Kiev CyberSport Arena, Ukraine. Watch the best Dota 2 teams compete for $15,000 and the title Star Series Champion.','http://dota2.starladder.tv',15105,0),
	(21,'The Defense 3','The Defense is back with new sponsors ROCCAT and own3D.tv. Watch 24 invited professional teams and 8 teams from an open qualifier battle for a prize pool of $20,000. This ticket will entitle you to over 100 broadcasted matches by Toby \"Tobi Wan Kenobi\" Dawson as well as one exclusive courier.','http://www.the-defense.com/en/start',15107,0),
	(22,'RaidCall Dota 2 League Season 2','The RaidCall Dota 2 League returns for a second $10,000 season. The top twelve teams in the western world battle it out six days a week for eleven total weeks live with commentary by Ayesee and Draskyl. Over 120 matches guaranteed.','http://d2l.evilgeniuses.net',15109,0),
	(23,'Dota 2 The Asia','This December Malaysia will be the focal point for all things eSports in Asia as gamers from all around the region turn their attention to what will be its last major eSporting event for the year - The Games Expo (TGX) Malaysia.','http://e-clubmalaysia.com/dota2/?page_id=2701 ',15111,0),
	(24,'G-League 2012','The famous G-League Tournament makes its Dota 2 debut on Dec. 25. Watch the best 8 asian teams, including IG, LGD and DK, compete for a prize pool of $40,000. Hosted by GameFY','http://gleague.gamefy.cn/',15119,0),
	(25,'Killing Spree: North America','Killing Spree is a perpetual King of the Hill event featuring four premier teams from North America. Each team will battle their way to the top and attempt to win three matches in a row for a \"killing spree\". Hosted by NEO Dota.','http://neodota.com/?page_id=1389',15014,0),
	(26,'SEA League','The SEA League features SEA\'s finest teams as they compete in several stages of the tournament. Two weeks of intense action will be commentated by GoDz and LD of BeyondthesummitTV.','http://sealeague.wordpress.com/',15122,0),
	(27,'The Premier League Season 4','Watch 10 of the best teams from Europe and America contend for a prize of $10,000. This ticket will entitle you to over 100 matches commentated by Blaze & Rainmaker and Russian commentary by Versuta. Also included is the exclusive courier \'Wynchell the Wyrmeleon\'.','http://www.thepremierleague.eu',15124,0),
	(28,'RaidCall EMS One Spring 2013','The RaidCall EMS One Spring 2013 is the new premier Dota2 competition. Over the course of several weeks, established teams will face up-and-coming challengers in the fight for a spot in the playoffs and eventually at the live event finals, competing for $39,000 in prize money.','http://dota2.raidcall-emsone.com/',15127,0),
	(29,'Star Series Season V','StarLadder\'s StarSeries Season 5 is back! Broadcast in 4 different languages with v1lat and TobiWan as headliners and a grand prize of $15,000 this should be the best StarSeries yet! The keystone of StarSeries is its LAN finals, held in Kiev Cybersport Arena. Includes an exclusive in-game Courier.','http://dota2.starladder.tv',15129,0),
	(30,'GEST Dota 2 - Feb and March','The Gigabyte E-Sports Tournament is sponsored by Gigabyte and hosted by DotaTalk. The winners of 8 GMPGL qualifiers from South-East Asia will compete against one another for another cash prize of $1500. The winners will compete against the Top Chinese Teams for another $1500.','https://www.dotatalk.com/gest-main-coverage-page',15134,0),
	(31,'Armageddon Dota 2 Grand Slam!','The battle between the best Dota 2 teams in Asia is on! Watch as they game fiercely to win a chance to be sponsored by the big names in corporate alliance!','http://e-clubmalaysia.com/dota2/?p=3350',15136,0),
	(32,'WePlay Dota 2','WePlay.TV proudly presents the WePlay Dota 2 League, brought to you by Logitech, Western Digital, and Inno3D! Beginning this March, thirty-two of Western Dota\'s best will duke it out online for $20,000 in cash & gear prizes with professional commentary from Beyond the Summit and WePlay.TV.','http://weplay.tv/',15138,0),
	(33,'DreamHack Dota2 Invitational','DreamHack Dota2 Invitational Features 8 of the top European teams, battling online for $6000 and the opportunity to qualify to DreamHack Summer Dota 2 Cup. 5 action packed weeks of content, produced by The GD Studio, with commentary by Draskyl, 2GD, Wagamama, Weppas and Bruno.','http://www.dreamhack.se/dhs13/2013/03/02/the-dreamhack-dota2-invitational/',15140,0),
	(34,'G-1 Champions League Season 5','The 5th G-1 Championship will feature an online qualifier to select the top Western team for a paid flight to the LAN finals in China to face teams like iG, LGD, DK and Orange. The Asia qualifiers will also use a prelim system to compete for spots at the LAN finals. The prize pool exceeds $53,000.','http://g1.2p.com/dota2/',15142,0),
	(36,'Netolic Pro League 2nd edition','16 teams, 8 from direct invitation and 8 from qualifiers, will compete for $4000. The tournament will feature teams like Orange, Zenith, Vici Gaming and MUFC. Commentary will be provided in English, Spanish and Portuguese.','http://www.netolic.tv/',15148,0),
	(37,'AtoD 3','ATOD3 is the third edition of the uniquely popular Reverse-Captain\'s Mode tournament presented by Peter \"HamSandwich\" Congdon. 12 teams from Europe and the Americas battle for a part of the $1,500 prizepool. Watch unconventional strategies as teams battle with less frequently played heroes.','',15149,0),
	(38,'E2Max L33T Championship','The inaugural E2Max L33T Championship (ELC) will feature a prize pool of SGD13,000 cash. online and LAN qualifiers from May to July, with the Grand Finals on 7th July at E2Max, Cineleisure, Singapore! ELC is presented by Cathay, hosted by Rapture Gaming Network, supported by e-Club and CM Storm.','http://www.rapturegaming.net/ELC',15151,0),
	(39,'GEST Dota 2 - April and May','The Gigabyte E-sports tournament is sponsored by Gigabyte and hosted by DotaTalk. The winners of 8 GMPGL Qualifiers from South-East Asia will compete against one another for another cash prize of $1500. The winners will then compete against the Top Chinese Teams for another $1500.','http://www.dotatalk.com/gest-main-coverage-page',15153,0),
	(40,'AMD Dota2 Premier League','AMD, in partnership with DotaTalk, proudly brings you the AMD Premier League. The tournament features SEA\'s finest teams as they compete for a total prize pool of $5,000. Two months of intense action will be commentated by GoDz, LD, Luminous and Blaze on BeyondthesummitTV.','http://www.dotatalk.com/tournament/amd-dota-2-premier-league',15155,0),
	(41,'Curse Dota 2 Invitational','The Curse Dota 2 Invitational, sponsored by Alienware, is an invitational bracket tournament that spans 3 weekends. 8 Teams were invited to compete in a double elimination format with a $10,000 prize pool. (1st $5,000 2nd $3,000 3rd $2,000)','http://www.curse.com/news/dota-2/48217-team-brackets-announced-curse-dota-2-invitational',15160,0),
	(42,'Dota 2 Super League','Ten top teams from home and abroad compete for two months in Shanghai, China for a total prize pool of 1.05 million yuan.','http://play.gosugamers.net/events/113-dota-2-super-league',15165,0),
	(43,'Pinoy Gaming Festival Summer Assembly','Watch 5 Filipino teams defend their home turf against Neolution.Orange, Neolution.International and PMS|Asterisk* at the Pinoy Gaming Festival Summer Assembly 2013 for a prize pool of $1,750.','http://www.pgf.ph/',15169,0),
	(44,'Rapture Gaming Network League','Rapture Gaming Network League 2013/2014 ticket gives you access to 198 matches over 9 months of the 10 premier teams in Asia vying for a prize pool of SGD19,000 cash, this is one of the biggest DOTA 2 leagues in Asia! Commentary in English, Filipino, Thai, and Vietnamese will be provided by RGN.','http://www.rapturegaming.net/',15171,0),
	(45,'Premier League Season 5','In cooperation with Norton, TPL returns with a new format. 8 best teams from Europe fight for entry to the $15,000 SuperCup by contesting each other in smaller cups. This ticket grants you entry to a total of 8 knockout tournaments, Stone Ruin HUD and the Wicked Succubus evolving set.','http://www.thepremierleague.eu',15173,0),
	(46,'StarSeries Season VI','Broadcast in 4 different languages with v1lat and TobiWan as headliners and a grand prize of $22,500 this should be the best StarSeries yet! The keystone of StarSeries is its LAN finals, held in Kiev Cybersport Arena. Includes an exclusive in-game Starladder HUD Skin.','http://dota2.starladder.tv/',15175,0),
